(-6128984648264094486, 'Simple, fast and powerful media player. Plays everything: Files, Discs, Webcams, Devices and Streams. VLC media player is a free and open source media player and multimedia framework written by the VideoLAN project. VLC is a portable multimedia player, encoder, and streamer supporting many audio and video codecs and file formats as well as DVDs, VCDs, and various streaming protocols. It is able to stream over networks and to transcode multimedia files and save them into various formats. The default distribution of VLC includes a large number of free decoding and encoding libraries, avoiding the need for finding/calibrating proprietary plugins. VLC is a packet-based media player, and it can play the video content of some damaged, incomplete, or unfinished videos. For example, files still downloading via peer-to-peer (P2P) networks.', '', 'http://www.w3.org/2001/XMLSchema#string', 4),
