(-522146952446503203, 'queXF (pronounced kweks-eff) takes scanned paper forms generated using queXML and reads them. Operators can then verify that queXF has read the form correctly. Once this is done, the data collected can be exported in a fixed width ASCII file with a DDI data description. queXF can be used as an alternative to programs such as Cardiff Teleform and Remark OMR, in some situations. It removes the need to manually enter form data, therefore reducing error and fatigue. It does OMR (Optical Mark Recognition) on each form to determine if boxes have been filled, and can use ICR (Intelligent Character Recognition) to determine what characters have been entered into boxes.', '', 'http://www.w3.org/2001/XMLSchema#string', 4),
