(34706259981675295, 'PWCT is not a Wizard for creating your application in 1 2 3 steps.    PWCT is a general-purpose visual programming tool  designed for novice and expert programmers.    A novice programmer can use PWCT to learn programming  concepts like Data Structure, Control Structure, Programming Paradigm,..etc.    An expert programmer can use PWCT to develop large and/or complex software.    Using PWCT we developed a textual programming language Compiler and Virtual Machine without writing a single line of code where the programming process done using the PWCT visual components. This language called Supernova and it''s free-open source (http://sourceforge.net/projects/supernova).    Another project developed using PWCT is the Smart POS System (http://sourceforge.net/projects/pos-sys/).    For more resources : http://doublesvsoop.sourceforge.net', '', 'http://www.w3.org/2001/XMLSchema#string', 4),
