(1061118788177331985, 'StoryText (formerly PyUseCase) is an unconventional GUI testing tool written in Python. It currently has mature support for PyGTK, beta status support for Java Swing, SWT/Eclipse RCP, and Tkinter, and very basic support for wxPython. Instead of recording GUI mechanics directly, it asks the user for descriptive names and hence builds up a "domain language" along with a "UI map file" that translates it into the current GUI layout. Instead of an "assertion" mechanism, it auto-generates a log of the GUI appearance and changes to it, so as to use that as a baseline for text-based testing, using e.g. TextTest. Instead of requiring the tester to add "wait" statements by hand, it includes support for instrumenting code so that "waits" can be recorded.', '', 'http://www.w3.org/2001/XMLSchema#string', 4),
