(3649593387976736110, 'The Anti-Spam SMTP Proxy (ASSP) Server project aims to create an open source platform-independent SMTP Proxy server which implements auto-whitelists, self learning Bayesian, Greylisting, DNSBL, DNSWL, URIBL, SPF, SRS, Backscatter, Virus scanning, attachment blocking, Senderbase and multiple other filter methods. Click ''Browse all files'' to download  the professional version 2.3.3 build 13217.    Note to V2 users build 12265 and less: don''t upgrade the module Thread::Queue to version 3.01 - this will cause ASSP to die -&gt; revert to version 2.11/2.12 of Thread::Queue    GUI-&gt;Server Setup-&gt;AutoUpdateASSP-&gt;"never upgrade these modules" or put ''Thread::Queue'' in to the file ''files/noupgrade.txt''    2.2.1 build 12313 and higher fixes this problem    V2 users should check the version of ''Regex::Optimizer'' and ''Regex::List'' in the ''lib'' folder - please upgrade these modules to version  Regex::Optimizer - 1.12  Regex::List - 1.06  available in the files section of this page    ', '', 'http://www.w3.org/2001/XMLSchema#string', 4),
