(6729522699106650612, 'Kiwix is an offline reader for Web content. It''s especially intended to make Wikipedia available offline.    With Kiwix, you can enjoy Wikipedia on a boat, in the middle of nowhere... or in Jail.     Kiwix manages to do that by reading ZIM files, a highly compressed open format with additional meta-data.', '', 'http://www.w3.org/2001/XMLSchema#string', 4),
