(9139338149774758958, 'CDex is a free Audio CD ripper, extractor and converter for various formats and  encoders, e.g. MP3, AAC, WMA, FLAC, OGG, WAV, MP2, Musepack, Ape, VQF and many  others. It features advanced jitter correction, ID3v2+v1 tagging, audio normalization,  transcoding of compressed audio files, analog input recording and also meta tagging with  CDDB and Musicbrainz. CDex has been translated to various languages.', '', 'http://www.w3.org/2001/XMLSchema#string', 4),
