(9196742952586138992, 'flashrd is an OpenBSD installer with an eye towards larger flash devices. It installs a complete OpenBSD system with "one-touch" upgrade capability. The primary targets are USB keys, flash disk modules, compact flash adapters, or hard disks. Installation is targeted towards infrastructure equipment. By default, it installs a complete OpenBSD system that stays mounted read-only during normal operation, with writes directed towards a memory filesystem, eliminating the need for frequent disk writes.', '', 'http://www.w3.org/2001/XMLSchema#string', 4),
